-- Check business
SELECT BUSINESS_TIN, BUSINESS_DESC FROM ACC_BUSINESSES WHERE BUSINESS_TIN = '000054207';

-- Check branches count (should be 315)
SELECT COUNT(*) AS BRANCH_COUNT FROM ACC_BUSINESSES_BRANCHES WHERE BUSINESS_TIN = '000054207';

-- Check user access count (should be 315)
SELECT COUNT(*) AS USER_ACCESS_COUNT FROM USE_SYS_BUSBRANCH_USERS WHERE BUSINESS_TIN = '000054207' AND USER_NAME = 'freshnfamous';

-- Check machines count (should be 409)
SELECT COUNT(*) AS MACHINE_COUNT FROM SLS_MACHINES;

-- Check permits count (should be 409)
SELECT COUNT(*) AS PERMIT_COUNT FROM ACC_PERMITS WHERE BUSINESS_TIN = '000054207';

-- Check machine permits count (should be 409)
SELECT COUNT(*) AS MACHINE_PERMIT_COUNT FROM ACC_MACHINE_PERMITS;

-- Check machines with effectivity dates
SELECT COUNT(*) AS machines_with_effectivity FROM SLS_MACHINES WHERE EFFECTIVITY_DATE IS NOT NULL;

-- Check that permits have valid PERMIT_STATUS for validation
SELECT COUNT(*) AS permits_with_valid_status FROM ACC_MACHINE_PERMITS WHERE PERMIT_STATUS IN ('105', '106', '108');

-- Check MIN to branch linkages
SELECT COUNT(*) AS LINKAGE_COUNT FROM SLS_MACHINEGROUP WHERE BUSINESS_TIN = '000054207' AND USER_NAME = 'freshnfamous';
